import React from 'react';
import {Menu} from 'semantic-ui-react';
import 'semantic-ui-css/semantic.min.css';

export default () => {
  return (
    <Menu tabular>
      <Menu.Item
        name='main'
      />
      <Menu.Item
        name='edit'
      />
    </Menu>
  );
}
